import './SubmittedDisplay.css';

function SubmittedDisplay() {
  return (
    <div className="SubmittedDisplay">
        <div className="SubmittedMessage">
            Your request has been queued
        </div>
        <button className="GoHomeButton">
            Continue
        </button>
    </div>
  );
}

export default SubmittedDisplay;
